import React from "react";
import ReactDOM from "react-dom";
import {
  createBrowserRouter,
  RouterProvider,
  Routes,
  Route,
} from "react-router-dom";
import App from "./App"; // Replace with the actual App component from your App.js
import ReviewPage from "./pages/ReviewPage.js"; // Replace with the actual ReviewPage component
import Subcriptions from "./pages/Subcriptions"; // Replace with the actual Contact component
import MenuPage from "./pages/MenuPage"; // Replace with the actual MenuPage component
import Locations from "./pages/Locations"; // Replace with the actual LocationPage component
import { fetchReviews } from "./api"; // Replace with the actual API functions

const router = createBrowserRouter([
  {
    path: "/",
    element: <App />, // Replace with the actual App component
    children: [
      {
        path: "/reviews",
        element: <ReviewPage />, // Replace with the actual ReviewPage component
        loader() {
          return fetchReviews();
        },
      },
      {
        path: "/subcriptions",
        element: <Subcriptions />, // Replace with the actual Contact component
      },
      {
        path: "/menu",
        element: <MenuPage />, // Replace with the actual MenuPage component
      },
      {
        path: "/location",
        element: <Locations />, // Replace with the actual LocationPage component
      },
    ],
  },
]);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>,
);
